To fix this issue, simply add #include <time.h> to the top of your C++ source code before any other includes so that both stdio.h and time.h are included together as part of the same translation unit (TU). Once done, recompile with g++ -Wall -Wextra -std=c++17 myfile.cpp && ./a.out again and see what happens

